//       data={data}
//       options={options}
//       width={"100%"}
//       height={"400px"}
//     />
//   );
// }

function App() {
  return (
    <Chart
      chartType="PieChart"
      data={data}
      options={options}
      width={"100%"}
      height={"400px"}
    />
  );
}

export default App;


